import React from "react";
//import ReactDom from "react-dom/client";
import { LOGO } from "./utils/constants";
import { useState ,useEffect} from "react";
import { Link } from "react-router-dom";
import { useSelector } from "react-redux";
const HeaderComponent = () => {

    const [btnRs,setbtnRS] = useState(["Login"]);
    console.log("header component");

    useEffect(()=>{
        console.log("useeffect call");
    },[btnRs])

    const cartItems = useSelector((store)=>store.cart.items);
    return (
        <div className="header flex justify-between bg-red-50">

            <div className="logo">
                <img className="w-20" src={LOGO} />
                
            </div>
            <div className="nav-items flex-wrap">
                <ul className="flex p-4 m-4 justify-center">
                    <li className="px-4"><Link to="/">Home</Link></li>
                   <li className="px-4"><Link to="/about">About Us</Link></li>
                   <li className="px-4"><Link to="/contact">Contact</Link></li>
                   <li className="px-4"><Link to="/grosery">Grosery</Link></li>
                   <li className="px-4"><Link to="/cart">Cart 0 items</Link></li>
                    <li className="px-4"><button onClick={() => {btnRs == 'Login'? setbtnRS("LogOut"):setbtnRS("Login");
                }}>{btnRs}</button></li>
                </ul>

            </div>

        </div>
    )
}
export default HeaderComponent;
